import Footer from '../components/Footer';
import Navbar from '../components/Navbar';

export default function Finish() {
  return (
    <>
      <Navbar />
      <div class="contact-container">
        <div>
          <h3>Obrigado</h3>
          <p>Em breve, entraremos em contato</p>
        </div>
        <div></div>
      </div>
      <Footer />
    </>
  )
}
